    "st-vincent-national-wildlife-refuge-fisheries-and-lake-rehabilitation-plan-1986",nt"isopen":
    false,nt"url": null,nt"notes": "This document outlines rehabilitation strategies
    for fisheries and lake rehabilitation on St. Vincent National Wildlife Refuge following
    hurricane damage. Following Hurricane Elena, September 1, 1985, St. Vincent experienced
    a devastating fish kill. The kill, discovered Friday, September 13, affected Lakes
    1-4 and Oyster Pond. Dying fish were observed through September 14. The kill was
    later determined to be the result of a reduction in dissolved oxygen (DO). Rehabilitation
    procedures will emphasize drawdowns augmented by mechanical and chemical vegetation
    control and burning. Lakes 1-3 and Oyster Pond will be drained March-June, 1986.
    Pumping will be employed to lower and maintain water levels 3-4 feet below normal.
    Lake 4 will not be lowered in 1986 to the detriment of Lake 5. Lake 5 will be used
    as a source for hatchery brood stock, especially brood stock for hand-painted bream.
    Therefore, the Lake 4 drawdown will have to be limited to a partial lowering because
    the extent to which Lake 4 manipulations can progress before adversely impacting
    Lake 5 are unknown.",nt"license_title": "License Not Specified",nt"extras":
